import React, { memo } from "react";
import {
  TextField,
  Button,
  Typography,
  Link,
  Grid,
  Box,
  Paper,
  Divider,
} from "@mui/material";
import {
  Google as GoogleIcon,
  Facebook as FacebookIcon,
  Person as PersonIcon,
  Lock as LockIcon,
} from "@mui/icons-material";
import { styled } from "@mui/system";
import { ThemeProvider, createTheme } from "@mui/material/styles";
import CssBaseline from "@mui/material/CssBaseline";

// Importing Poppins and Roboto fonts
import "@fontsource/poppins/400.css";
import "@fontsource/poppins/600.css"; // Poppins SemiBold
import "@fontsource/roboto/300.css";
import "@fontsource/roboto/400.css";
import "@fontsource/roboto/500.css";
import "@fontsource/roboto/700.css"; // Roboto Bold

import barbellIcon from "../Images/Login/23603572.png";
import bulkyManImage from "../Images/Login/Bulky_man.png";

// Create a theme to use Roboto globally
const theme = createTheme({
  typography: {
    fontFamily: "Roboto, Arial, sans-serif",
  },
});

// Styled components using @mui/system
const BackgroundBox = styled(Box)(({ theme }) => ({
  display: "flex",
  justifyContent: "center",
  alignItems: "center",
  height: "100vh",
  backgroundColor: theme.palette.grey[200],
}));

const FormBox = styled(Paper)(({ theme }) => ({
  padding: theme.spacing(4),
  display: "flex",
  flexDirection: "column",
  alignItems: "center",
  width: "683px",
  height: "768px",
  boxShadow: theme.shadows[4],
  borderBottomLeftRadius: "30px",
  borderTopLeftRadius: "30px",
  textAlign: "center",
  position: "relative",
  justifyContent: "space-between",
}));

const InputBox = styled(Box)(({ theme }) => ({
  display: "flex",
  alignItems: "center",
  justifyContent: "center",
  backgroundColor: theme.palette.grey[300],
  borderRadius: "15px",
  width: "364px",
  height: "52px",
  marginBottom: theme.spacing(2),
  padding: theme.spacing(0, 1),
}));

const StyledTextField = styled(TextField)({
  flex: 1,
  "& .MuiInputBase-root": {
    height: "100%",
    display: "flex",
    alignItems: "center",
    padding: 0,
    backgroundColor: "transparent",
  },
  "& .MuiInputBase-input": {
    height: "100%",
    padding: "0 12px",
    display: "flex",
    alignItems: "center",
    textAlign: "left",
    lineHeight: "normal",
  },
  "& fieldset": {
    border: "none",
  },
});

const IconWrapper = styled(Box)(({ theme }) => ({
  padding: theme.spacing(1),
  display: "flex",
  alignItems: "center",
}));

const LoginButton = styled(Button)(({ theme }) => ({
  width: "124px",
  height: "52px",
  backgroundColor: "#94C1C6",
  color: theme.palette.common.white,
  borderRadius: "16px",
  marginTop: theme.spacing(3),
  alignSelf: "center",
  fontFamily: "Poppins, Arial, sans-serif",
  fontSize: "12px",
  fontWeight: theme.typography.fontWeightBold,
  "&:hover": {
    backgroundColor: "#82B2B6",
  },
}));

const RightBoxText = styled(Typography)(({ theme }) => ({
  color: theme.palette.common.white,
  fontFamily: "Roboto, Arial, sans-serif",
  fontSize: "32px",
  fontWeight: theme.typography.fontWeightBold,
  textAlign: "center",
  textShadow: "2px 2px 6px rgba(0, 0, 0, 0.7)",
  position: "absolute",
  bottom: "30px",
  left: 0,
  right: 0,
  zIndex: 1,
  lineHeight: 1.2,
}));

const SocialLoginButton = styled(Button)(({ theme }) => ({
  width: "364px",
  height: "52px",
  backgroundColor: theme.palette.common.white,
  color: theme.palette.common.black,
  fontFamily: "Poppins, Arial, sans-serif",
  fontSize: "12px",
  fontWeight: theme.typography.fontWeightBold,
  borderRadius: "16px",
  border: `1px solid ${theme.palette.grey[400]}`, // Add outline/border
  display: "flex",
  justifyContent: "center",
  alignItems: "center",
  textTransform: "none",
  "&:hover": {
    backgroundColor: theme.palette.grey[300],
  },
  "& .MuiButton-startIcon": {
    color: theme.palette.common.black, // Set the icon color to black
  },
}));

const LoginWithOthers = styled(Typography)(({ theme }) => ({
  display: "flex",
  alignItems: "center",
  fontFamily: "Poppins, Arial, sans-serif",
  fontSize: "16px",
  fontWeight: 600,
  marginTop: theme.spacing(4),
  marginBottom: theme.spacing(2),
  "&::before, &::after": {
    content: '""',
    flex: 1,
    borderBottom: `1px solid ${theme.palette.grey[400]}`,
    margin: theme.spacing(0, 1),
  },
}));

const Login = memo(() => {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <BackgroundBox>
        <Box
          sx={{
            display: "flex",
            flexDirection: { xs: "column", md: "row" },
            alignItems: "center",
            justifyContent: "center",
          }}
        >
          <FormBox>
            <Typography
              component="h1"
              sx={{
                mt: 2,
                fontFamily: "Poppins, Arial, sans-serif",
                fontSize: "16px",
                fontWeight: 400,
                pb: 1,
              }}
            >
              Login and start bulking right now!
            </Typography>
            <img src={barbellIcon} alt="Barbell Icon" width="320" height="112" />
            <Box
              component="form"
              noValidate
              sx={{
                mt: 2,
                width: "100%",
                display: "flex",
                flexDirection: "column",
                alignItems: "center",
              }}
            >
              <InputBox>
                <IconWrapper>
                  <PersonIcon />
                </IconWrapper>
                <StyledTextField
                  margin="normal"
                  required
                  fullWidth
                  id="username"
                  label="Username"
                  name="username"
                  autoComplete="username"
                  autoFocus
                  variant="outlined"
                  InputLabelProps={{
                    shrink: true,
                  }}
                />
              </InputBox>
              <InputBox>
                <IconWrapper>
                  <LockIcon />
                </IconWrapper>
                <StyledTextField
                  margin="normal"
                  required
                  fullWidth
                  name="password"
                  label="Password"
                  type="password"
                  id="password"
                  autoComplete="current-password"
                  variant="outlined"
                  InputLabelProps={{
                    shrink: true,
                  }}
                />
              </InputBox>
              <Link
                href="#"
                variant="body2"
                sx={{
                  alignSelf: "flex-start",
                  mb: 2,
                  fontFamily: "Poppins, Arial, sans-serif",
                  fontSize: "12px",
                  fontWeight: "bold",
                  pl: "150px",
                  textDecoration: "none",
                  color: "inherit",
                  "&:hover": {
                    textDecoration: "underline",
                  },
                }}
              >
                Forgot your password?
              </Link>
              <LoginButton type="submit" variant="contained">
                Login
              </LoginButton>
              <LoginWithOthers align="center">
                <strong>Login</strong> with Others
              </LoginWithOthers>
              <Grid container spacing={2} sx={{ justifyContent: "center" }}>
                <Grid item>
                  <SocialLoginButton
                    variant="contained"
                    startIcon={<GoogleIcon />}
                  >
                    Login with <strong>&nbsp;Google</strong>
                  </SocialLoginButton>
                </Grid>
                <Grid item>
                  <SocialLoginButton
                    variant="contained"
                    startIcon={<FacebookIcon />}
                  >
                    Login with <strong>&nbsp;Facebook</strong>
                  </SocialLoginButton>
                </Grid>
              </Grid>
              <Typography
                variant="body2"
                align="center"
                sx={{
                  mt: 4, // Add more space
                  fontFamily: "Poppins, Arial, sans-serif",
                  fontSize: "13px",
                  fontWeight: 600,
                  display: "flex",
                  justifyContent: "center",
                  gap: "4px",
                }}
              >
                <span style={{ color: "black" }}>Not a member?</span>{" "}
                <Link href="#" style={{ color: "#5B9DAA", textDecoration: "none" }}>
                  Register now
                </Link>
              </Typography>
            </Box>
          </FormBox>
          <Box
            sx={{
              display: { xs: "none", md: "flex" },
              justifyContent: "center",
